ะะตะณัะปััะฝะพ ะพะฑะฝะพะฒะปัะตะผ ะผะพะดัะปะธ, ััะพะฑั ะฒะฐัะฐ ัะฐะฑะพัะฐ ัยะะฐัะบะตัะพะผ ััะฐะปะฐ ะตัั ะฟัะพัะต. ะยััะพั ัะฐะท ัะดะตะปะธะปะธ ะพัะพะฑะพะต ะฒะฝะธะผะฐะฝะธะต ะฐะฒัะพัะธะทะฐัะธะธ ะธยัะดะพะฑััะฒั ัะฐะฑะพัั ัยะบะฐัะฐะปะพะณะพะผ.

ะะพะดัะปั 1ะก:ะัะตะดะฟัะธััะธะต:

๐ธ ะััััะฐั ะทะฐะณััะทะบะฐ ัะพัะพ: ะตัะปะธ ะฝะตยะดะพะฑะฐะฒะธะปะธ ะธะทะพะฑัะฐะถะตะฝะธั ะบยัะพะฒะฐัั, ะทะฐะณััะทะธัะต ะธัยะฒัะตะณะพ ะฒยะฟะฐัั ะบะปะธะบะพะฒ ะฒยัะพัะผะต ัะตะดะฐะบัะธัะพะฒะฐะฝะธั;

๐ธ ะะตะดะฐะบัะธัะพะฒะฐะฝะธะต ะฒัะตะณะพ ะธยััะฐะทั: ััะพะฑั ะพะฑะฝะพะฒะธัั ัะตะฝั, ะพััะฐัะบะธ ะธะปะธ ะดััะณะธะต ะฟะฐัะฐะผะตััั ััะฐะทั ัยะฝะตัะบะพะปัะบะธั ัะพะฒะฐัะพะฒ, ะฒะพัะฟะพะปัะทัะนัะตัั ััะฝะบัะธะตะน ะผะฐััะพะฒะพะณะพ ัะตะดะฐะบัะธัะพะฒะฐะฝะธั;

