ะะพะดัะปั 1ะก-ะะธััะธะบั:

๐ธ ะะตัััะพัะฝัะน ัะพะบะตะฝ: ะฝะฐัััะพะนัะต ะพะดะธะฝ ัะฐะท ัะพะบะตะฝ ะฐะฒัะพัะธะทะฐัะธะธ, ะฐยะดะฐะปััะต ะพะฝยัยะฒะฐะผะธ ะฝะฐะฒัะตะณะดะฐ;

